import React from "react";
import { Pie } from "react-chartjs-2";
import fulldata from "../../context/fulldata";

export default function PieChart(props) {
    console.log(fulldata);
  return (
    <div className="chart-container-pies">
     <Pie 
        redraw={true} 
        data={{
            labels : props.labels,
            datasets: [{
            data: props.data,
            backgroundColor: [
                'rgb(255, 99, 132)',
                'rgb(54, 162, 235)',
                'rgb(255, 205, 86)'
            ],
            }]
        }
        } 
      />
    </div>
  );
}
